// Scala
@Converter
def toSAXSourceFromStream(source: StreamSource, exchange: Exchange): SAXSource = {
    val inputSource: InputSource = if (source.getReader != null) {
        new InputSource(source.getReader)
    } else {
        new InputSource(source.getInputStream)
    }
    inputSource.setSystemId(source.getSystemId)
    inputSource.setPublicId(source.getPublicId)
    var xmlReader: XMLReader = null
    var sfactory: SAXParserFactory = null
    try {
        if (exchange != null) {
            sfactory = exchange.getProperty(Exchange.SAXPARSER_FACTORY, classOf[SAXParserFactory])
        }
        if (sfactory == null) {
            sfactory = SAXParserFactory.newInstance
            try {
                sfactory.setFeature(javax.xml.XMLConstants.FEATURE_SECURE_PROCESSING, true)
            } catch {
                case e: Exception =>
                    LOG.warn("SAXParser doesn't support the feature {} with value {}, due to {}.", javax.xml.XMLConstants.FEATURE_SECURE_PROCESSING, "true", e)

        } else {
            sfactory.setFeature(javax.xml.XMLConstants.FEATURE_SECURE_PROCESSING, true);
        }
        sfactory.setValidating(false);
        sfactory.setNamespaceAware(true);
        SAXParser parser = sfactory.newSAXParser();
        xmlReader = parser.getXMLReader();
    } catch (Exception ex) {
        LOG.warn("Cannot create the SAXParser XMLReader, due to {}", ex);
    }
    return new SAXSource(xmlReader, inputSource);
}

